import React, { memo } from 'react'

const Home = () => {
  return (
    <div>
      <Title content='Blog Post App'/>
      <Panel/>
      Populate
    </div>
  )
}

export default memo(Home)

const Title = ({content}) => {
    return (
        <h1 className='text-red-500'>{content}</h1>
    )
}

function Panel (){
    return (
        <div className="container">
            <button>Posts</button>
            <button>Users</button>
            <button>Comments</button>
        </div>
    )
}

function Populate (){
    return (
        <div className="container">

        </div>
    )
}
